select `financiallog`.`type` AS `type`,`financiallog`.`num` AS `num`,`financiallog`.`time` AS `time`,`project`.`id` AS `id` from ((((`financiallog` join `financialdetail` on((`financiallog`.`financialdetailid` = `financialdetail`.`id`))) join `financialmodeldetail` on((`financialdetail`.`financialmodeldetailid` = `financialmodeldetail`.`id`))) join `financialmodel` on((`financialmodeldetail`.`financialmodelid` = `financialmodel`.`id`))) join `project` on((`financialmodel`.`projectid` = `project`.`id`)))
